<style>
  .post-container {
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #6BE1FF !important;
    text-align: center;
    margin: 0;
    padding: 0;
  }

  .post-container > .post {
    width: 620px;
  }

  svg {
    width: 100%;
    box-shadow: 0 2px 5px 0px rgba(0, 0, 0, 0.3);
  }

  #tonearm {
    transform-origin: 85% 65%;
    /* animation-name: rotatetonearm; */
    animation-duration: 5s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
  }


  #sun {
    transform-origin: 50% 35.9%;
    animation-name: sunhover;
    animation-duration: 1.5s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
  }
  
  #vinylcover {
    animation-name: coverhover;
    animation-duration: 1.5s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
  }

  #hovertxt {
    animation-name: texthover;
    animation-duration: 1.5s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
  }

  @keyframes rotatetonearm {
    0% {
      transform: translateX(300px) rotate(0deg);
    }

    15% {
      transform: translateX(300px) rotate(-25deg);
    }

    90% {
      transform: translateX(300px) rotate(-45deg);
    }

    100% {
      transform: translateX(300px) rotate(0deg);
      animation-delay: 500ms;
    }
  }

  @keyframes sunhover {
    0% {
      transform: translateY(500px);
    }

    50% {
      transform: translateY(400px);
    }

    100% {
      transform: translateY(500px);
    }
  }

  @keyframes sunhovered {
    0% {
      transform: translateY(500px);
    }

    100% {
      transform: translateY(350px);
    }
  }

  @keyframes texthover {
    0% {
      transform: translateY(25px);
    }

    50% {
      transform: translateY(0px);
    }

    100% {
      transform: translateY(25px);
    }
  }

  @keyframes coverhover {
    0% {
      transform: translateY(-460px);
    }

    50% {
      transform: translateY(-410px);
    }

    100% {
      transform: translateY(-460px);
    }
  }

  @keyframes movecover {
    0% {
      transform: translateY(-460px);
    }

    100% {
      transform: translateY(0px);
    }
  }

  @keyframes movesun {
    0% {
      transform: translateY(500px);
    }

    100% {
      transform: translateY(0px);
    }
  }

  @keyframes backcover {
    0% {
      transform: translateY(0px);
    }

    100% {
      transform: translateY(-460px);
    }
  }

  @keyframes backsun {
    0% {
      transform: translateY(0px);
    }

    100% {
      transform: translateY(500px);
    }
  }

  @keyframes rotatesun {
    0% {
      transform: rotate(0deg);
      box-shadow: 0 0 0px 0px rgba(255, 255, 0, 1);
    }

    100% {
      transform: rotate(-360deg);
      box-shadow: 0 0 30px 30px rgba(255, 255, 0, 1);
    }
  }
</style>

<script>

  var $sun = $('#sun');
  var $tonearm = $('#tonearm');
  var $cover = $('#vinylcover');
  var $hovertxt = $('#hovertxt');

  init();

  function init() {
    $sun.css('animation-name', 'sunhover');
    $sun.css('animation-iteration-count', 'infinite');
    $sun.css('animation-timing-function', 'ease-in-out');
    $sun.css('animation-duration', '1.5s');

    $hovertxt.css('animation-name', 'texthover');
    $hovertxt.css('animation-duration', '1.5s');

    $cover.css('animation-name', 'coverhover');
    $cover.css('animation-iteration-count', 'infinite');
    $cover.css('animation-duration', '1.5s');

    $tonearm.css('transform', 'translateX(300px');
    $tonearm.css('animation-name', 'none');
  };

  let click = 0;

  function move() {
    $sun.css('animation-name', 'movesun');
    $sun.css('animation-iteration-count', '1');
    $sun.css('animation-duration', '0.3s');

    $cover.css('animation-name', 'movecover');
    $cover.css('animation-iteration-count', '1');
    $cover.css('animation-duration', '0.3s');
  }

  function back() {
    $tonearm.css('transform', 'rotate(0deg)');
    
    $sun.css('animation-duration', '0.3s');
    $sun.css('animation-name', 'backsun');
    $sun.css('animation-iteration-count', '1');
    $sun.css('animation-timing-function', 'ease-in-out');

    $cover.css('animation-duration', '0.3s');
    $cover.css('animation-timing-function', 'ease-in-out');
    $cover.css('animation-name', 'backcover');
    $cover.css('animation-iteration-count', '1');
  };

  function loop() {
    $sun.css('animation-timing-function', 'linear');
    $sun.css('animation-iteration-count', 'infinite');
    $sun.css('animation-duration', '2.5s');
    $sun.css('animation-name', 'rotatesun');

    $hovertxt.css('animation-name', 'none');

    $cover.css('transform', 'translateY(0px)');
    $cover.css('animation-name', 'none');
    $cover.css('animation-duration', '2s');

    $tonearm.css('animation-name', 'rotatetonearm');
  }

  $sun.attr('data-click-state', 0);
  $sun.on('click', function () {
    move();

      setTimeout(function () {
        loop();
      }, 300);

      setTimeout(function () {
        back();
      }, 5300);

      setTimeout(function () {
        init();
      }, 5600);
    });
    // if ($(this).attr('data-click-state') == 0) {
    //   $(this).attr('data-click-state', 1);
    //   move();

    //   setTimeout(function () {
    //     loop();
    //   }, 300);

    //   setTimeout(function () {
    //     back();
    //   }, 5300);

    //   setTimeout(function () {
    //     init();
    //   }, 5600);
    // }};

</script>

</html>
